import React, { useState, useEffect, useRef } from 'react';
import './Filters.css';
import { useNavigate } from 'react-router-dom';

const Filters = ({ data = [] }) => {
    const [query, setQuery] = useState('');
    const [filteredResults, setFilteredResults] = useState([]);
    const [isDropdownVisible, setIsDropdownVisible] = useState(false);
    const [congressYear, setCongressYear] = useState(''); // State for Congress year filter
    const [state, setState] = useState(''); // State for State filter
    const [chamber, setChamber] = useState(''); // State for Chamber filter (House or Senate)

    const searchRef = useRef(null);
    const inputRef = useRef(null);
    const navigate = useNavigate();

    useEffect(() => {
        // Filter data based on the query and additional filters
        if (data.length > 0) {
            const results = data.filter((item) => {
                const title = item.bill.bill.title?.toLowerCase();
                const billNumber = `${item.bill.bill.type}.${item.bill.bill.number}`.toLowerCase();

                const matchesQuery = query ? title.includes(query.toLowerCase()) || billNumber.includes(query.toLowerCase()) : true;
                const matchesCongressYear = congressYear ? item.bill.bill.congress === congressYear : true;
                const matchesState = state ? item.bill.bill.state === state : true;
                const matchesChamber = chamber ? item.bill.bill.originChamber === chamber : true;

                return matchesQuery && matchesCongressYear && matchesState && matchesChamber;
            });
            setFilteredResults(results.slice(0, 10)); // Limit results for dropdown
        } else {
            setFilteredResults([]);
        }
    }, [query, data, congressYear, state, chamber]);

    useEffect(() => {
        const handleClickOutside = (event) => {
            if (searchRef.current && !searchRef.current.contains(event.target)) {
                setIsDropdownVisible(false);
            }
        };

        document.addEventListener('mousedown', handleClickOutside);

        return () => {
            document.removeEventListener('mousedown', handleClickOutside);
        };
    }, []);

    const handleResultClick = (id) => {
        navigate(`/bill/${id}`);
    };

    const handleFocus = () => {
        setIsDropdownVisible(true);
        if (inputRef.current) {
            const length = inputRef.current.value.length;
            inputRef.current.setSelectionRange(length, length);
        }
    };

    return (
        <div className="filter" ref={searchRef}>
            <input
                type="text"
                placeholder="Search bills by title or number"
                value={query}
                onChange={(e) => setQuery(e.target.value)}
                onFocus={handleFocus}
                className="filter-input"
                ref={inputRef}
            />

            {/* Congress Year Filter */}
            <select value={congressYear} onChange={(e) => setCongressYear(e.target.value)} className="filter-select">
                <option value="">All Congress Years</option>
                <option value="117">117th Congress</option>
                <option value="116">116th Congress</option>
                {/* Add other Congress years as needed */}
            </select>

            {/* State Filter */}
            <select value={state} onChange={(e) => setState(e.target.value)} className="filter-select">
                <option value="">All States</option>
                <option value="CA">California</option>
                <option value="TX">Texas</option>
                {/* Add other states as needed */}
            </select>

            {/* Chamber Filter */}
            <select value={chamber} onChange={(e) => setChamber(e.target.value)} className="filter-select">
                <option value="">All Chambers</option>
                <option value="House">House</option>
                <option value="Senate">Senate</option>
            </select>

            {isDropdownVisible && filteredResults.length > 0 && (
                <div className="filter-dropdown">
                    {filteredResults.map((item) => (
                        <div
                            key={item._id}
                            className="filter-dropdown-item"
                            onClick={() => handleResultClick(item._id)}
                        >
                            {item.bill.bill.type}.{item.bill.bill.number}: {item.bill.bill.title}
                        </div>
                    ))}
                </div>
            )}
        </div>
    );
};

export default Filters;
